import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Row from 'react-bootstrap/Row'
import AuthenticationService from '../service/AuthenticationService';

class NavigationBar extends Component{

    render() {
        const isUserLoggedIn = AuthenticationService.isUserLoggedIn();

        return(
            <>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand href="/">Budget Tracker</Navbar.Brand>
                <Nav className="mr-auto">
                <Nav.Link href="#home">Productions</Nav.Link>
                <Nav.Link href="/about">About</Nav.Link>
                </Nav>
                {/* <Form inline>
                <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                <Button variant="outline-info">Search</Button>
                </Form> */}
                <Navbar.Collapse className="justify-content-end">
                    {!isUserLoggedIn && 
                        <Row>
                            <Nav className="mr-auto">
                            <Nav.Link href="/login">Login</Nav.Link>
                            <Nav.Link href="/new/user">Create Account</Nav.Link>
                            </Nav>
                            {/* <li><Link className="nav-link mr-2" to="/login" style={{color: "white"}}>Login</Link></li> */}
                            {/* <li><Link className="nav-link mr-2" to="/new/user" style={{color: "white"}}>Create Account</Link></li> */}
                        </Row>}
                        {isUserLoggedIn && 
                            <Navbar.Text>
                            Signed in as: <a href="/login">Mark Otto</a>
                            </Navbar.Text>
                        }
                    <Navbar.Text>
                    Signed in as: <a href="#login">Mark Otto</a>
                    </Navbar.Text>
                </Navbar.Collapse>
            </Navbar>
            </>
        )
    }
}

export default NavigationBar
